GUIFX.keyInfoContent.text=Sizdi\u00f1 kiltter katalog\u0131\u00f1\u0131z avtomatt\u0131 t\u00fcrde jasal\u0131nat\u0131n j\u00e4ne ta\u00f1dal\u011fan\r\n bir rettik pernetaqtan\u0131\u00f1 kiltterin saqtayd\u0131\r\n S\u0131rtq\u0131 (USB) d\u00efskiden kilt katalog\u0131n ta\u00f1da\u00f1\u0131z\r\n\r\nQos\u0131m\u015fa parol qos\u0131m\u015fa k\u00fc\u015f qosad\u0131 \u015f\u00effrlaw\r\n jo\u011fal\u011fan / urlan\u011fan kilt fayldar\u0131 derekteri\u00f1izdi bu\u011fattan \u015f\u0131\u011fara almayd\u0131\r\n\r\n ========================== =======================\r\n\r\n \u015e\u00effrlan\u011fan fayldar\u0131\u00f1\u0131z ben kiltteri\u00f1izdi jup etip saqta\u00f1\u0131z\r\nSaqt\u0131q k\u00f6\u015firmesin s\u0131rtq\u0131 k\u00fcyde saqta\u00f1\u0131z (USB) ) d\u00efskilerdi de basqarad\u0131\r\n\r\nKilttik fayldars\u0131z j\u00e4ne\r\n qup\u00efya s\u00f6zben m\u00e4limetterdi \u015f\u00effrlaw m\u00fcmkin emes!\r\n
