\u0442\u049b\u044b \u043a\u04af\u0439\u0434\u0435 \u0441\u0430\u049b\u0442\u0430\u04a3\u044b\u0437 (USB) ) \u0434\u0438\u0441\u043a\u0456\u043b\u0435\u0440\u0434\u0456 \u0434\u0435 \u0431\u0430\u0441\u049b\u0430\u0440\u0430\u0434\u044b\r\n\r\n\u041a\u0456\u043b\u0442\u0442\u0456\u043a \u0444\u0430\u0439\u043b\u0434\u0430\u0440\u0441\u044b\u0437 \u0436\u04d9\u043d\u0435\r\n \u049b\u04b1\u043f\u0438\u044f \u0441\u04e9\u0437\u0431\u0435\u043d \u043c\u04d9\u043b\u0456\u043c\u0435\u0442\u0442\u0435\u0440\u0434\u0456 \u0448\u0438\u0444\u0440\u043b\u0430\u0443 \u043c\u04af\u043c\u043a\u0456\u043d \u0435\u043c\u0435\u0441!\r\n
